port = ""

# datetime object containing current date and time
now = datetime.now()

# Get the time and date to update the arduino
today = "T" + now.strftime("%Y:%m:%d:%H:%M:%S")

# List out usb vid number so we can look for it in the available serial ports
compatibledevices = [
 #Arduino Uno
 "VID:PID=2341:0043",
]

def getComPort():
  global bootloader_active
  devicelist = list(comports())
  for device in devicelist:
    for vidpid in compatibledevices:
      if  vidpid in device[2]:
        port=device[0]
        bootloader_active = (compatibledevices.index(vidpid) & 1) == 0
        return port


port = getComPort()
SerialPort = Serial(port,115200, timeout=0)
#SerialPort.close()
time.sleep(4.0)	


print("Wait for Serial port")
while SerialPort.read():
    time.sleep(0.05)


SerialPort.write(today.encode())
time.sleep(3.0)	

SerialPort.write("I".encode())

# Wait for 'continue' signal as arduino needs to clear some flash first
response = ""
target = 'OK';
okContinue = 0
while okContinue == 0:
    response = (response + (SerialPort.read().decode()))[-len(target):]
    if target == response:
        okContinue = 1

