# divide the data into smaller chunks
ArduBuffer=64
for packets in range(int(len(values)/ArduBuffer)):
    tempArray = bytearray(ArduBuffer)
    for i in range(ArduBuffer):
        tempArray[i] = values[(packets*ArduBuffer)+i]
    
    write_bytes = struct.pack('>' + 'B' * len(tempArray),  *tempArray) 
    SerialPort.write(write_bytes)
    okContinue = 0
    response = ""
    target = 'OK'
    while okContinue == 0:
        response = (response + (SerialPort.read().decode()))[-len(target):]
        if target == response:
            okContinue = 1


